import React from "react";
import "./App.css";
import Clock from "./Clock";

class App extends React.Component {
  constructor(props) {}

  greet() {
    const x = 2;
    if (x === 1) {
      return <h1>Hello</h1>;
    } else {
      return <h1>Byeee</h1>;
    }
  }

  render() {
    return this.greet();
  }
}

export default App;
